    prefixes = ['http://', 'https://']
    valid_tlds = ['.com', '.org', '.edu']
    if not url.startswith(tuple(prefixes)):
        return False
    dot_index = url.find('.', len(prefixes[0]))
    if dot_index != -1:
        return False
    if any((char.isspace() for char in url)):
        return False
    if not url.endswith(tuple(valid_tlds)):
        return False
    return True

